import React, { Component } from 'react'
import Breadcrumbs from '@material-ui/core/Breadcrumbs';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';
import {withRouter} from 'react-router'
import { Grid } from '@material-ui/core';
import PeopleOutlineIcon from '@material-ui/icons/PeopleOutline';
import LinkIcon from '@material-ui/icons/LinkIcon';
export class UsersPage extends Component {

    handleNav(data) {
        this.props.history.push(data)
    }

    render() {
        return(
            <div>
                <div style={{ display: 'flex' }}>
                    <div style={{ flex: '0 0 2%' }}>
                        <PeopleOutlineIcon style={{ fontSize: '22px' }}/>
                    </div>
                    <div style={{ flex: '1', textAlign: 'left' }}>
                        <Typography color="subbtitle">Users</Typography>
                    </div>
                </div>
                <Grid container direction="row" alignItems="center">
                    <Grid item>
                        <LinkIcon  />
                    </Grid>
                    <Grid item>
                        revolve
                    </Grid>
                </Grid>
                <Breadcrumbs aria-label="breadcrumb" style={{ fontSize: '13px' }}>
                    <Link color="inherit" style={{ cursor: 'pointer' }} onClick={() => this.handleNav('/')}>
                        Home
                    </Link>
                    <Link color="inherit" style={{ cursor: 'pointer' }} onClick={() => this.handleNav('/')}>
                        Users
                    </Link>
                    <Typography style={{ fontSize: '13px' }} color="textPrimary">List Users</Typography>
                </Breadcrumbs>
            </div>
        );
    }
}

export default withRouter(UsersPage)
